import React, { Component } from 'react';
import {Carrusel,Grid,Row,Col} from 'react-boodstrap';
import './App.css';
import { findRenderedDOMComponentWithClass } from 'react-dom/test-utils';

class App extends Component {
  render() {

    return (
      <div className="App">
        <Grid>
          <Row>
            <Col xs={12} md={8}>
              <h1></h1>
            </Col>
          </Row>
        </Grid>
      </div>
    );
  }

  delectProduct(code) {
    var temp = this.state.products.filter((item) => item.code !== code);
    this.setState({
      products: temp
    })
  }
}

export default App;
